import React, { Component } from 'react';
import './login.css'

class Login extends Component {
  constructor(props) {
    super(props);
    this.state = {
      user: '',
      password: ''
    };
  }

  userinput = (e) => {
    this.setState({
      user: e.target.value
    })
  }

  passwordinput = e => {
    this.setState({
      password: e.target.value
    })
  }

  render() {
    return (
      <div className="container-fluid">
        <div className="row ">
          <div className="panel panel-default col-md-4 col-md-offset-4">
              <div className="panel-heading">欢迎来到后台管理系统</div>   
            <div className="panel-body">
            <form action="">
              
            </form>
            </div>
          </div>
        </div>
      </div>



    );
  }
}

